import React from 'react';

const AdBanner = () => {
  return (
    <div>
      <h2>My Website</h2>
      <iframe
        src="https://www.youtube.com/embed/Yqw6Y1U1G64"
        width="728"
        height="90"
        frameBorder="0"
        scrolling="no"
      ></iframe>
    </div>
  );
};

export default AdBanner;
